import "./App.css";

import React from 'react';
import { useState, useEffect } from "react";
import axios from 'axios';
import { Input, InputGroup } from "rsuite";
import SearchIcon from "@rsuite/icons/Search";
import { Table, Button } from 'rsuite';


const { Column, HeaderCell, Cell } = Table;
const styles = {
  width: 500,
  height: 40,
  marginBottom: 10,
};

const data2 = [
  {
    id: 1,
    email: 'Leora13@yahoo.com',
    firstName:
      'Red Wacky League AntlezBroketheStereoNeon Kitching Josh Bennett Evolution Dreams 红色古怪联盟丹尼尔梅斯马修',
    lastName: 'Schuppe',
    city: 'New Gust',
    companyName: 'Lebsack - Nicolas'
  },
  {
    id: 2,
    email: 'Mose_Gerhold51@yahoo.com',
    firstName: 'Janis',
    lastName: 'Bode',
    city: 'New Gust',
    companyName: 'Glover - Hermiston'
  },
  {
    id: 3,
    city: 'New Gust',
    email: 'Frieda.Sauer61@gmail.com',
    firstName: 'Makenzie Vandervort',
    lastName: null,
    companyName: 'Williamson - Kassulke'
  },
  {
    id: 4,
    email: 'Eloisa.OHara@hotmail.com',
    firstName: 'Ciara',
    lastName: 'Towne',
    city: 'Vandervort',
    companyName: 'Hilpert, Eichmann and Brown'
  }
];



function App() {

  const [query, setQuery] = useState("")
  const [data, setData] = useState([])

  useEffect()

  return (
    <div
      style={{
        display: "flex",
        height: "100vh",
        flexDirection: "row",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <div>
        <InputGroup style={styles}>
          <Input
            value={query}
            onChange={(value) => {
              setQuery(value)
            }}
          />
          <InputGroup.Button
            onClick={() => {
              console.log(query);
              setQuery("")
            }}
          >
            <SearchIcon />
          </InputGroup.Button>
        </InputGroup>

        <Table
      height={400}
      width={500}
      data={data}
      onRowClick={rowData => {
        console.log(rowData);
      }}
    >
      <Column width={60} align="center" fixed>
        <HeaderCell>Id</HeaderCell>
        <Cell dataKey="id" />
      </Column>

      <Column width={150}>
        <HeaderCell>First Name</HeaderCell>
        <Cell dataKey="firstName" />
      </Column>

      <Column width={150}>
        <HeaderCell>Last Name</HeaderCell>
        <Cell dataKey="lastName" />
      </Column>

      <Column width={100}>
        <HeaderCell>City</HeaderCell>
        <Cell dataKey="city" />
      </Column>

      <Column width={100}>
        <HeaderCell>Company</HeaderCell>
        <Cell dataKey="companyName" />
      </Column>

      <Column width={80} fixed="right">
        <HeaderCell>...</HeaderCell>

        <Cell style={{ padding: '6px' }}>
          {rowData => (
            <Button appearance="link" onClick={() => alert(`id:${rowData.id}`)}>
              Delete
            </Button>
          )}
        </Cell>
      </Column>
    </Table>
      </div>
    </div>
  );
}

export default App;
